CREATE TABLE `gps_conversion` (`id` bigint(20) NOT NULL AUTO_INCREMENT, `lat` int(11) DEFAULT NULL, `lng` int(11) DEFAULT NULL, `offset_lat` int(11) DEFAULT NULL, `offset_lng` int(11) DEFAULT NULL, PRIMARY KEY (`id`), UNIQUE KEY `lat` (`lat`,`lng`), KEY `gps_conversion_lat_long` (`lat`,`lng`) ) DEFAULT CHARSET=utf8mb4;
